$(function(){
    //province;
    //proSchool;
    //学校名称 激活状态
    $("#school").focus(function(){
    	var _this = $(this) ,pos = _this.offset();
        $("div[class='provinceSchool']").css({top:pos.top+_this.innerHeight(),left:pos.left,display:'block'});
    });
    //初始化省下拉框
    var provinceArray = "";
    var provicneSelectStr = "";
    for(var i=0,len=province.length;i<len;i++){
        provinceArray = province[i];
        provicneSelectStr = provicneSelectStr + "<option value='"+provinceArray[0]+"'>"+provinceArray[1]+"</option>"
    } 
    $("div[class='proSelect'] select").html(provicneSelectStr);
    //初始化学校列表
    var selectPro = $("div[class='proSelect'] select").val();
    var schoolUlStr = "";
    var tempSchoolName = "";
    var schoolListStr = proSchool[selectPro];
    for(var i=0;i<300;i++){
        tempSchoolName = schoolListStr[i]['colname'];
        if(tempSchoolName.length>13){
        schoolUlStr = schoolUlStr + "<li col='"+schoolListStr[i]['colid']+"' class='DoubleWidthLi'>"+schoolListStr[i]['colname']+"</li>"
        }else {
        schoolUlStr = schoolUlStr + "<li col='"+schoolListStr[i]['colid']+"'>"+schoolListStr[i]['colname']+"</li>"
        }
        if(typeof(schoolListStr[i+1])=="undefined")i = 300;
    }
    $("div[class='schoolList'] ul").html(schoolUlStr);
    //省切换事件
    $("div[class='proSelect'] select").change(function(){
        if("99"!=$(this).val()){
            $("div[class='proSelect'] span").show();
            $("div[class='proSelect'] input").hide();
            schoolUlStr = "";
            var schoolListStr = proSchool[$(this).val()];
            for(var i=0;i<300;i++){
                tempSchoolName = schoolListStr[i]['colname'];
                if(tempSchoolName.length>13){
                    schoolUlStr = schoolUlStr + "<li col='"+schoolListStr[i]['colid']+"' class='DoubleWidthLi'>"+schoolListStr[i]['colname']+"</li>"
                }else {
                    schoolUlStr = schoolUlStr + "<li col='"+schoolListStr[i]['colid']+"'>"+schoolListStr[i]['colname']+"</li>"
                }
                if(typeof(schoolListStr[i+1])=="undefined")i = 300;
            }
            $("div[class='schoolList'] ul").html(schoolUlStr);
        }else {
            $("div[class='schoolList'] ul").html("");
            $("div[class='proSelect'] span").hide();
            $("div[class='proSelect'] input").show();
        }
    });
    //学校列表mouseover事件
    $("div[class='schoolList'] ul").on("mouseover","li",function(){
        $(this).css("background-color","#72B9D7");
    });
    //学校列表mouseout事件
    $("div[class='schoolList'] ul").on("mouseout","li",function(){
        $(this).css("background-color","");
    });
    //学校列表点击事件
    $("div[class='schoolList'] ul").on("click","li",function(){
        $("#school").val($(this).html());
        $("#colid").val($(this).attr("col"));
        $("div[class='provinceSchool']").hide();
        $(".ac_results").hide();
        if($("#game").val() == 'dance'){
        	checkschool();	
        }
    });
    //按钮点击事件
    $("div[class='button']").on("click","a",function(){
        var flag = $(this).attr("flag");
        if("0"==flag){
            $("div[class='provinceSchool']").hide();
        }else if("1"==flag){
            var selectPro = $("div[class='proSelect'] select").val();
            if("99"==selectPro){
                $("#school").val($("div[class='proSelect'] input").val());
            }
            $("div[class='provinceSchool']").hide();
        }
    });
});